import { JSON } from "react-router-dom";

const authReducers = (state = { data: null }, actions) => {
  switch (actions.type) {
    case "AUTH":
      localStorage.setItem("Profile", JSON.stringify({ ...action?.data }));
      return { ...state, data: action?.data };
      return state;

    default:
      return state;
  }
};

export default authReducers;
